import { Component } from '@angular/core';
import { MatDialog } from '@angular/material/dialog';
import { Module } from 'src/app/module';
import { ModuleService } from 'src/app/module.service';

@Component({
  selector: 'app-homefront',
  templateUrl: './homefront.component.html',
})
export class HomefrontComponent {
  modules: Module[] = []; // Assuming you have a Module model

  constructor(private dialog: MatDialog, private moduleService: ModuleService) {}

  ngOnInit(): void {
    this.moduleService.getModulesList().subscribe((data: Module[]) => {
      this.modules = data;
    });
  }

}
